Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.textFile("onsite_data.txt")
      .map(line => line.split("\t"))
      .map(arr => (arr(0), arr(1).toLong))

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Int)] = Map()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cachePart = cache.synchronized {
        cache
      }
      iter.map { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          val cacheEntry = cachePart.get(query)
          if (cacheEntry == None || timestamp - cacheEntry.get._1 > 12 * 60 * 60 * 1000) {
            // Cache miss
            cachePart.put(query, (timestamp, 1))
            (query, false)
          } else {
            // Cache hit
            cachePart.put(query, (timestamp, cacheEntry.get._2 + 1))
            (query, true)
          }
        } else {
          (query, true)
        }
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._2.toDouble / hitRate._1
    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster. The cache is initialized as an empty mutable map.

The job then processes the onsite data by iterating over each partition. For each query in the partition, it checks if it is in the top frequent queries. If it is, it checks if the query is in the cache and if it is still valid (i.e., it has not expired). If the query is not in the cache or it has expired, it is a cache miss and the query is added to the cache with a count of 1. If the query is in the cache and it is still valid, it is a cache hit and the count is incremented. If the query is not in the top frequent queries, it is considered a hit.

The job then calculates the hit rate by dividing the total number of hits by the total number of queries. The hit rate is printed to the console.

